import styled from "styled-components";

export const CupideonHomeWrapper = styled.div`
  height: 100vh;
  width: 100vw;
  background: red;
  position: relative;
`

export const CupideonHomeLogo = styled.img`
  position: absolute;
  top: 0;
  left: 0;
  height: 80px;
`
